import { useState } from 'react';
import CharacterBox from './components/CharacterBox';
import './App.css';
import CharacterList from './components/CharacterList';

function App() {
  const initialCharacters = [
    {
      id: 1,
      name: 'SpongeBob SquarePants',
      description:
        'A friendly and optimistic sea sponge who works at the Krusty Krab.',
      image:
        'data:image/webp;base64,',
    },
    {
      id: 2,
      name: 'Patrick Star',
      description: "SpongeBob's best friend, a lazy and dimwitted starfish.",
      image:
        'data:image/webp;base64,',
    },
    {
      id: 3,
      name: 'Squidward Tentacles',
      description: "SpongeBob's grumpy co-worker who hates his job.",
      image:
        'data:image/webp;base64,',
    },
  ];

  const [characters, setCharacters] = useState(initialCharacters);
  const [editingId, setEditingId] = useState(null);

  const handleEditClick = (character) => {
    setEditingId(character.id);
  };

  const handleDeleteClick = (id) => {
    setCharacters(characters.filter((character) => character.id !== id));
  };

  const handleSaveClick = (id, updatedCharacter) => {
    setCharacters(
      characters.map((character) =>
        character.id === id ? { ...character, ...updatedCharacter } : character
      )
    );
    setEditingId(null);
  };

  return (
    <div className="dashboard">
      <CharacterList
        list={characters}
        editingId={editingId}
        handleSaveClick={handleSaveClick}
        handleEditClick={handleEditClick}
        handleDeleteClick={handleDeleteClick}
      />
    </div>
  );
}

export default App;
